        function dataAtualFormatada(data) {

            if (data === """") {
                return ""Não foi definido uma data."";
            }

            data = data.replace(""-"", """");
            data = data.replace(""-"", """");

            console.log(data);

            var Dia = data.substring(6, 9);
            var Mes = data.substring(4, 6);
            var Ano = data.substring(0, 4);

            return Dia + ""/"" + Mes + ""/"" + Ano;
        }

